import '../App.css';
import {littleLemon, toDoList, simpleCalculator} from '../assets/project';

export function ProjectSection() {
    return (
        <div className="project-section">
            <div>
                <img src={littleLemon} alt="Little Lemon website"></img>
                <h3>Little Lemon Website</h3>
            </div>
            <div>
                <img src={toDoList} alt="a to do list app"></img>
                <h3>To Do List App</h3>
            </div>
            <div>
                <img src={simpleCalculator} alt="a simple calculator"></img>
                <h3></h3>
            </div>
        </div>
    )
}
